#include <hal/pcie/pcie_database.hpp>

const pcie_database_entry *find_in_pcie_database(uint16_t vendor_id, uint16_t device_id)
{
    for (size_t i = 0; pcie_device_database_size > i; i++)
    {
        if (pcie_device_database[i].vendor_id == vendor_id && pcie_device_database[i].device_id == device_id)
        {
            return &pcie_device_database[i];
        }
    }

    return nullptr;
}

